import React from 'react';

import {withFirebase } from '../Firebase';
import "./Signout.css";

const LogOutButton =({firebase }) => (

  <button id="this_beautiful_thing" type="button" onClick={firebase.doSignOut}>
    Sign Out
  </button>
);


export default withFirebase(LogOutButton);
